    if (readAll) {
        if (recursively) {
            for (GEOTransitSuggestedRoute * i in self->_clientSuggestedRoutes)
                [i readAll:YES];
            for (GEORPSuggestedRouteIndex * i in self->_problematicRouteIndexs)
                [i readAll:YES];
            [self->_startWaypoint readAll:YES];
            [self->_endWaypoint readAll:YES];
            for (GEORPInstructionCorrection * i in self->_instructionCorrections)
                [i readAll:YES];
        }
        self->_flags.read_directionsResponseId = YES;
        self->_flags.read_overviewScreenshotImageData = YES;
        self->_flags.read_clientSuggestedRoutes = YES;
        self->_flags.read_problematicRouteIndexs = YES;
        self->_flags.read_startWaypoint = YES;
        self->_flags.read_endWaypoint = YES;
        self->_flags.read_instructionCorrections = YES;
    } else {
        for (size_t i = 0; tags != NULL && tags[i] != 0; ++i) {
            switch (tags[i]) {
                case 3 /* directionsResponseId */:
                    self->_flags.read_directionsResponseId = YES;
                    break;
                case 4 /* overviewScreenshotImageData */:
                    self->_flags.read_overviewScreenshotImageData = YES;
                    break;
                case 10 /* clientSuggestedRoutes */:
                    self->_flags.read_clientSuggestedRoutes = YES;
                    break;
                case 11 /* problematicRouteIndexs */:
                    self->_flags.read_problematicRouteIndexs = YES;
                    break;
                case 14 /* startWaypoint */:
                    self->_flags.read_startWaypoint = YES;
                    break;
                case 15 /* endWaypoint */:
                    self->_flags.read_endWaypoint = YES;
                    break;
                case 16 /* instructionCorrections */:
                    self->_flags.read_instructionCorrections = YES;
                    break;
            }
        }
    }

    #undef requiredLazyFieldCount
    if (readAll) {
        // reader is __unsafe_unretained
        const BOOL hadError = PBReaderHasError(reader);
        os_unfair_lock_lock_with_options(&(self->_readerLock), OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
        self->_reader = nil;
        os_unfair_lock_unlock(&(self->_readerLock));
        return !hadError;
    }
    return !PBReaderHasError(reader);
}

+ (BOOL)isValid:(__unsafe_unretained PBDataReader *)reader
{
    return GEORPDirectionsProblemIsValid(reader);
}

BOOL GEORPDirectionsProblemIsValid(__unsafe_unretained PBDataReader *reader) {
    PBDataReaderMark resetMark;
    resetMark.pos = reader.position;
    resetMark.length = reader.length;
    #define returnValue(X) do { \
        const BOOL v = X; \
        PBReaderRecallMark(reader, &resetMark); \
        return v; \
    } while(0)
    while (PBReaderHasMoreData(reader)) {
        uint32_t tag = 0;
        uint8_t aType = 0;
        PBReaderReadTag32AndType(reader, &tag, &aType);

        if (PBReaderHasError(reader))
            break;

        if (aType == TYPE_END_GROUP) {
            break;
        }

        switch (tag) {

            case 3 /* directionsResponseId */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                if (!PBReaderSkipValueWithTag(reader, tag, aType))
                    returnValue(NO);
                break;
                break;
            case 4 /* overviewScreenshotImageData */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                if (!PBReaderSkipValueWithTag(reader, tag, aType))
                    returnValue(NO);
                break;
                break;
            case 8 /* problematicStepIndex */:
                if (TYPE_VARINT != aType)
                    returnValue(NO);
                PBReaderReadUint32(reader);
                break;
            case 10 /* clientSuggestedRoutes */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                {
                    PBDataReaderMark mark_clientSuggestedRoute;
                    if (!PBReaderPlaceMark(reader, &mark_clientSuggestedRoute))
                        returnValue(NO);
                    if (!GEOTransitSuggestedRouteIsValid(reader))
                        returnValue(NO);
                    PBReaderRecallMark(reader, &mark_clientSuggestedRoute);
                }
                break;
            case 11 /* problematicRouteIndexs */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                {
                    PBDataReaderMark mark_problematicRouteIndex;
                    if (!PBReaderPlaceMark(reader, &mark_problematicRouteIndex))
                        returnValue(NO);
                    if (!GEORPSuggestedRouteIndexIsValid(reader))
                        returnValue(NO);
                    PBReaderRecallMark(reader, &mark_problematicRouteIndex);
                }
                break;
            case 13 /* problematicLineIndex */:
                if (TYPE_VARINT != aType)
                    returnValue(NO);
                PBReaderReadUint32(reader);
                break;
            case 14 /* startWaypoint */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                {
                    PBDataReaderMark mark_startWaypoint;
                    if (!PBReaderPlaceMark(reader, &mark_startWaypoint))
                        returnValue(NO);
                    if (!GEORPUserSearchInputIsValid(reader))
                        returnValue(NO);
                    PBReaderRecallMark(reader, &mark_startWaypoint);
                }
                break;
            case 15 /* endWaypoint */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                {
                    PBDataReaderMark mark_endWaypoint;
                    if (!PBReaderPlaceMark(reader, &mark_endWaypoint))
                        returnValue(NO);
                    if (!GEORPUserSearchInputIsValid(reader))
                        returnValue(NO);
                    PBReaderRecallMark(reader, &mark_endWaypoint);
                }
                break;
            case 16 /* instructionCorrections */:
                if (TYPE_LENGTH_DELIMITED != aType)
                    returnValue(NO);
                {
                    PBDataReaderMark mark_instructionCorrection;
                    if (!PBReaderPlaceMark(reader, &mark_instructionCorrection))
                        returnValue(NO);
                    if (!GEORPInstructionCorrectionIsValid(reader))
                        returnValue(NO);
                    PBReaderRecallMark(reader, &mark_instructionCorrection);
                }
                break;
            default:
                if (!PBReaderSkipValueWithTag(reader, tag, aType))
                    returnValue(NO);
                break;
        }
    }
    returnValue(!PBReaderHasError(reader));
    #undef returnValue
}

- (BOOL)readFrom:(PBDataReader *)reader
{
    return GEORPDirectionsProblemReadAllFrom(self, reader, NO);
}

- (void)writeTo:(PBDataWriter *)writer
{
    os_unfair_lock_lock_with_options(&_readerLock, OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
    PBDataReader *reader = _reader;
    os_unfair_lock_unlock(&_readerLock);
    @synchronized(reader) {
        if (reader) {
            if (!GEORPDirectionsProblemIsDirty(self)) {
                reader->_length = (NSUInteger)_readerMarkLength;
                [reader seekToOffset:(NSUInteger)_readerMarkPos];
                uint32_t length = (_readerMarkLength - _readerMarkPos);
                NSData *data = [reader readBytes:length];
                [writer writeData:data];
                return;
            }
        }
    }

    [self readAll:NO];

    /* directionsResponseId */
    {
        if (self->_directionsResponseId)
        {
            PBDataWriterWriteDataField(writer, self->_directionsResponseId, 3);
        }
    }

    /* overviewScreenshotImageData */
    {
        if (self->_overviewScreenshotImageData)
        {
            PBDataWriterWriteDataField(writer, self->_overviewScreenshotImageData, 4);
        }
    }

    /* problematicStepIndex */
    {
        if (self->_flags.has_problematicStepIndex)
        {
            PBDataWriterWriteUint32Field(writer, self->_problematicStepIndex, 8);
        }
    }

    /* clientSuggestedRoutes */
    {
        for (GEOTransitSuggestedRoute * i_clientSuggestedRoute in self->_clientSuggestedRoutes)
        {
            PBDataWriterWriteSubmessage(writer, i_clientSuggestedRoute, 10);
        }

    }

    /* problematicRouteIndexs */
    {
        for (GEORPSuggestedRouteIndex * i_problematicRouteIndex in self->_problematicRouteIndexs)
        {
            PBDataWriterWriteSubmessage(writer, i_problematicRouteIndex, 11);
        }

    }

    /* problematicLineIndex */
    {
        if (self->_flags.has_problematicLineIndex)
        {
            PBDataWriterWriteUint32Field(writer, self->_problematicLineIndex, 13);
        }
    }

    /* startWaypoint */
    {
        if (self->_startWaypoint != nil)
        {
            PBDataWriterWriteSubmessage(writer, self->_startWaypoint, 14);
        }
    }

    /* endWaypoint */
    {
        if (self->_endWaypoint != nil)
        {
            PBDataWriterWriteSubmessage(writer, self->_endWaypoint, 15);
        }
    }

    /* instructionCorrections */
    {
        for (GEORPInstructionCorrection * i_instructionCorrection in self->_instructionCorrections)
        {
            PBDataWriterWriteSubmessage(writer, i_instructionCorrection, 16);
        }

    }
}

BOOL GEORPDirectionsProblemIsDirty(__unsafe_unretained GEORPDirectionsProblem *self)
{
    if (self == nil) {
        return NO;
    }
    
    BOOL dirty = NO
        || self->_flags.wrote_directionsResponseId
        || self->_flags.read_directionsResponseId
        || self->_flags.wrote_overviewScreenshotImageData
        || self->_flags.read_overviewScreenshotImageData
        || self->_flags.wrote_problematicStepIndex
        || self->_flags.wrote_clientSuggestedRoutes
        || self->_flags.wrote_problematicRouteIndexs
        || self->_flags.read_problematicRouteIndexs
        || self->_flags.wrote_problematicLineIndex
        || self->_flags.wrote_startWaypoint
        || (self->_flags.read_startWaypoint && GEORPUserSearchInputIsDirty(self->_startWaypoint))
        || self->_flags.wrote_endWaypoint
        || (self->_flags.read_endWaypoint && GEORPUserSearchInputIsDirty(self->_endWaypoint))
        || self->_flags.wrote_instructionCorrections
    ;

    if (!dirty) {

            if (self->_flags.read_clientSuggestedRoutes) {
                for (GEOTransitSuggestedRoute *i in self->_clientSuggestedRoutes) {
                    if (GEOTransitSuggestedRouteIsDirty(i)) {
                        return YES;
                    }
                }
            }

            if (self->_flags.read_instructionCorrections) {
                for (GEORPInstructionCorrection *i in self->_instructionCorrections) {
                    if (GEORPInstructionCorrectionIsDirty(i)) {
                        return YES;
                    }
                }
            }
    }

    return dirty;
}


- (void)copyTo:(GEORPDirectionsProblem *)other
{
    [self readAll:NO];
    os_unfair_lock_lock_with_options(&_readerLock, OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
    other->_reader = _reader;
    other->_readerMarkPos = _readerMarkPos;
    other->_readerMarkLength = _readerMarkLength;
    os_unfair_lock_unlock(&_readerLock);
    if (_directionsResponseId)
    {
        other.directionsResponseId = _directionsResponseId;
    }
    if (_overviewScreenshotImageData)
    {
        other.overviewScreenshotImageData = _overviewScreenshotImageData;
    }
    if (self->_flags.has_problematicStepIndex)
    {
        other->_problematicStepIndex = _problematicStepIndex;
        other->_flags.has_problematicStepIndex = YES;
    }
    if ([self clientSuggestedRoutesCount])
    {
        [other clearClientSuggestedRoutes];
        NSUInteger clientSuggestedRoutesCnt = [self clientSuggestedRoutesCount];
        for (NSUInteger i = 0; i < clientSuggestedRoutesCnt; i++)
        {
            [other addClientSuggestedRoute:[self clientSuggestedRouteAtIndex:i]];
        }
    }
    if ([self problematicRouteIndexsCount])
    {
        [other clearProblematicRouteIndexs];
        NSUInteger problematicRouteIndexsCnt = [self problematicRouteIndexsCount];
        for (NSUInteger i = 0; i < problematicRouteIndexsCnt; i++)
        {
            [other addProblematicRouteIndex:[self problematicRouteIndexAtIndex:i]];
        }
    }
    if (self->_flags.has_problematicLineIndex)
    {
        other->_problematicLineIndex = _problematicLineIndex;
        other->_flags.has_problematicLineIndex = YES;
    }
    if (_startWaypoint)
    {
        other.startWaypoint = _startWaypoint;
    }
    if (_endWaypoint)
    {
        other.endWaypoint = _endWaypoint;
    }
    if ([self instructionCorrectionsCount])
    {
        [other clearInstructionCorrections];
        NSUInteger instructionCorrectionsCnt = [self instructionCorrectionsCount];
        for (NSUInteger i = 0; i < instructionCorrectionsCnt; i++)
        {
            [other addInstructionCorrection:[self instructionCorrectionAtIndex:i]];
        }
    }
}

- (id)copyWithZone:(NSZone *)zone
{
    GEORPDirectionsProblem *copy = [[[self class] allocWithZone:zone] init];
    os_unfair_lock_lock_with_options(&_readerLock, OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
    PBDataReader *reader = _reader;
    os_unfair_lock_unlock(&_readerLock);
    @synchronized(reader) {
        if (reader) {
            BOOL wroteAny = NO
                || _flags.wrote_directionsResponseId
                || _flags.wrote_overviewScreenshotImageData
                || _flags.wrote_problematicStepIndex
                || _flags.wrote_clientSuggestedRoutes
                || _flags.wrote_problematicRouteIndexs
                || _flags.wrote_problematicLineIndex
                || _flags.wrote_startWaypoint
                || _flags.wrote_endWaypoint
                || _flags.wrote_instructionCorrections
            ;
            if (!wroteAny) {
                reader->_length = (NSUInteger)_readerMarkLength;
                [reader seekToOffset:(NSUInteger)_readerMarkPos];
                GEORPDirectionsProblemReadAllFrom(copy, reader, NO);
                return copy;
            }
            [self readAll:NO];
        }
    }
    copy->_directionsResponseId = [_directionsResponseId copyWithZone:zone];
    copy->_overviewScreenshotImageData = [_overviewScreenshotImageData copyWithZone:zone];
    if (self->_flags.has_problematicStepIndex)
    {
        copy->_problematicStepIndex = _problematicStepIndex;
        copy->_flags.has_problematicStepIndex = YES;
    }
    for (GEOTransitSuggestedRoute * v in _clientSuggestedRoutes)
    {
        GEOTransitSuggestedRoute * vCopy = [v copyWithZone:zone];
        [copy addClientSuggestedRoute:vCopy];
    }
    for (GEORPSuggestedRouteIndex * v in _problematicRouteIndexs)
    {
        GEORPSuggestedRouteIndex * vCopy = [v copyWithZone:zone];
        [copy addProblematicRouteIndex:vCopy];
    }
    if (self->_flags.has_problematicLineIndex)
    {
        copy->_problematicLineIndex = _problematicLineIndex;
        copy->_flags.has_problematicLineIndex = YES;
    }
    copy->_startWaypoint = [_startWaypoint copyWithZone:zone];
    copy->_endWaypoint = [_endWaypoint copyWithZone:zone];
    for (GEORPInstructionCorrection * v in _instructionCorrections)
    {
        GEORPInstructionCorrection * vCopy = [v copyWithZone:zone];
        [copy addInstructionCorrection:vCopy];
    }
    return copy;
}


- (BOOL)isEqual:(id)object
{
    GEORPDirectionsProblem *other = (GEORPDirectionsProblem *)object;
    if (![other isMemberOfClass:[self class]]) {
        return NO;
    }
    [self readAll:YES];
    [other readAll:YES];


    return YES
    &&
    ((!self->_directionsResponseId && !other->_directionsResponseId) || [self->_directionsResponseId isEqual:other->_directionsResponseId])
    &&
    ((!self->_overviewScreenshotImageData && !other->_overviewScreenshotImageData) || [self->_overviewScreenshotImageData isEqual:other->_overviewScreenshotImageData])
    &&
    ((self->_flags.has_problematicStepIndex && other->_flags.has_problematicStepIndex && self->_problematicStepIndex == other->_problematicStepIndex) || (!self->_flags.has_problematicStepIndex && !other->_flags.has_problematicStepIndex))
    &&
    ((!self->_clientSuggestedRoutes && !other->_clientSuggestedRoutes) || [self->_clientSuggestedRoutes isEqual:other->_clientSuggestedRoutes])

    &&
    ((!self->_problematicRouteIndexs && !other->_problematicRouteIndexs) || [self->_problematicRouteIndexs isEqual:other->_problematicRouteIndexs])

    &&
    ((self->_flags.has_problematicLineIndex && other->_flags.has_problematicLineIndex && self->_problematicLineIndex == other->_problematicLineIndex) || (!self->_flags.has_problematicLineIndex && !other->_flags.has_problematicLineIndex))
    &&
    ((!self->_startWaypoint && !other->_startWaypoint) || [self->_startWaypoint isEqual:other->_startWaypoint])
    &&
    ((!self->_endWaypoint && !other->_endWaypoint) || [self->_endWaypoint isEqual:other->_endWaypoint])
    &&
    ((!self->_instructionCorrections && !other->_instructionCorrections) || [self->_instructionCorrections isEqual:other->_instructionCorrections])

    ;
}

- (NSUInteger)hash
{
    [self readAll:YES];
    NSUInteger value = 0;

    return value
    ^
    [self->_directionsResponseId hash]
    ^
    [self->_overviewScreenshotImageData hash]
    ^
    (self->_flags.has_problematicStepIndex ? PBHashInt((NSUInteger)self->_problematicStepIndex) : 0)
    ^
    [self->_clientSuggestedRoutes hash]
    ^
    [self->_problematicRouteIndexs hash]
    ^
    (self->_flags.has_problematicLineIndex ? PBHashInt((NSUInteger)self->_problematicLineIndex) : 0)
    ^
    [self->_startWaypoint hash]
    ^
    [self->_endWaypoint hash]
    ^
    [self->_instructionCorrections hash]
    ;
}

- (void)mergeFrom:(GEORPDirectionsProblem *)other
{
    [other readAll:NO];
    if (other->_directionsResponseId)
    {
        [self setDirectionsResponseId:other->_directionsResponseId];
    }
    if (other->_overviewScreenshotImageData)
    {
        [self setOverviewScreenshotImageData:other->_overviewScreenshotImageData];
    }
    if (other->_flags.has_problematicStepIndex)
    {
        self->_problematicStepIndex = other->_problematicStepIndex;
        self->_flags.has_problematicStepIndex = 1;
    }
    for (GEOTransitSuggestedRoute * iter_clientSuggestedRoutes in other->_clientSuggestedRoutes)
    {
        [self addClientSuggestedRoute:iter_clientSuggestedRoutes];
    }
    for (GEORPSuggestedRouteIndex * iter_problematicRouteIndexs in other->_problematicRouteIndexs)
    {
        [self addProblematicRouteIndex:iter_problematicRouteIndexs];
    }
    if (other->_flags.has_problematicLineIndex)
    {
        self->_problematicLineIndex = other->_problematicLineIndex;
        self->_flags.has_problematicLineIndex = 1;
    }
    if (self->_startWaypoint && other->_startWaypoint)
    {
        [self->_startWaypoint mergeFrom:other->_startWaypoint];
    }
    else if (!self->_startWaypoint && other->_startWaypoint)
    {
        [self setStartWaypoint:other->_startWaypoint];
    }
    if (self->_endWaypoint && other->_endWaypoint)
    {
        [self->_endWaypoint mergeFrom:other->_endWaypoint];
    }
    else if (!self->_endWaypoint && other->_endWaypoint)
    {
        [self setEndWaypoint:other->_endWaypoint];
    }
    for (GEORPInstructionCorrection * iter_instructionCorrections in other->_instructionCorrections)
    {
        [self addInstructionCorrection:iter_instructionCorrections];
    }
}


